import React from 'react';

class TaskList extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            users: ['Alex', 'Luis']
        }
      }

    componentDidMount() {
        this.setState({ users: [...this.state.users, 'Pedro']});
    }

    render() {
        return (
            <div>
                {JSON.stringify(this.state.users)}
            </div>
        )

    }
}

export default TaskList;
